import java.util.regex.Pattern
import java.util.regex.Matcher

//Grab incoming response and split at spaces
def INCOMING_HarResponse = context.expand( '${#TestCase#INCOMING_HarResponse}' )

String statusCode;
Matcher matcher;

//Define regexes (\\d regers to any digit [0-9], ^ refers to the start of a string, and \$ refers to the end of the string)
Pattern statusPattern = Pattern.compile("HTTP/\\d.\\d \\d{3}")
matcher = statusPattern.matcher(INCOMING_HarResponse)
if(matcher.find())
{
	statusCode = matcher.group(0); 
}

testRunner.testCase.setPropertyValue("OUTPUT_HTTPStatus", statusCode);

import com.eviware.soapui.SoapUI
import com.eviware.soapui.settings.ProxySettings

def Input_Proxy_Setting = context.expand( '${#TestCase#WantProxyOnorOff}' )


if(Input_Proxy_Setting.equalsIgnoreCase('Off'))
{

	log.info "PROXY Has Been Turned OFF! as the input from the user is to switch "+Input_Proxy_Setting+" the proxy"
	SoapUI.settings.setString( ProxySettings.ENABLE_PROXY, "false")
	SoapUI.updateProxyFromSettings();
}
else
{
	log.info "PROXY Has Been Turned On! as the input from the user is to switch "+Input_Proxy_Setting+" the proxy"
	SoapUI.settings.setString( ProxySettings.ENABLE_PROXY, "true")
	SoapUI.updateProxyFromSettings();
}

