		log.info "Value of the Expected vvariable%%%%%%%%"+tempArray[j].find{it.key == "expected"}?.value*/
		//if(slurpResult.findResult(tempArray[j].get('check'))==null)
		if(temp2['expected']=="null")
		{			
			//temp2['expected']=""
			tempArray[j].put('expected',"")
			//log.info tempArray[j].get('expected')
			//log.info "The Expected value of "+tempArray[j].get('node')+" was null string and was replaced by null value"	
		}
	}
