													[node:"root", check:{slurpResult}, expected:null],
													[node:"message", check:{slurpResult.message}, expected:EXPECTED_message],
													[node:"code", check:{slurpResult.code}, expected:EXPECTED_code],
													[node:"cause", check:{slurpResult.cause}, expected:EXPECTED_cause],
