		validationCheck = j.checkJSONValue(slurpResult, errorResponse[i].get('node'), errorResponse[0].get('check'), errorResponse[i].get('check'),errorResponse[i].get('expected'), validationCheck)
	}
	else
	{
		validationCheck = j.checkJSONNodeExists(slurpResult, errorResponse[i].get('node'), errorResponse[0].get('check'), errorResponse[i].get('check'),false , validationCheck)
	}
}


